import React from 'react';
import ReactDOM from 'react-dom';

function Card(props) {
    return (
        <div className='cards'>
            <div className='card'>
                <img src={props.imgsrc} alt='mypic' className='card__img' />
                <div className='card__info'>
                    <span className='card__category'>
                    {props.title}
                    </span>
                    <h3 className='card__title'>
                    {props.sname}
                    </h3>
                    <a href= {props.link} target='_blank'>
                        <button> Watch Now </button>
                    </a>

                </div>
            </div>
        </div>
    );
}
ReactDOM.render(
    <>
        <Card 
        imgsrc='https://wallpapercave.com/wp/wp4995602.jpg' 
        title='A Netflix Original Series' sname='DARK' 
        link='https://www.netflix.com/in/title/80100172' />

        <Card 
            imgsrc='https://img2.goodfon.com/original/1366x768/4/18/mentalist-the-mentalist-simon-1346.jpg' 
        title='An Amazon Original Series' sname='The Mentalist' 
        link='https://www.primevideo.com/detail/The-Mentalist/0FJTYK2JJYPK3ZA10FUT08RXXI?ref_=dvm_pds_gen_in_as_s_gt_dsaothercategoriesalldays|m_static-c_c511090269730'
        />
    </>,
    document.getElementById('root')
);

